    <div class="layout">

        <style>
        
        	.preloader__wrapper {
        		background: #3E3E3E;
        		position: fixed;
        		height: 100vh;
        		min-height: 300px;
        		width: 100vw;
        		z-index: 300;
        	}
        
        	.preloader__in {
        		position: relative;
        		display: -webkit-box;
        		display: -ms-flexbox;
        		display: flex;
        		-webkit-box-pack: center;
        		-ms-flex-pack: center;
        		justify-content: center;
        		-webkit-box-align: center;
        		-ms-flex-align: center;
        		align-items: center;
        		height: 100%;
        		width: 100%;
        		gap: 18px;
        	}
        
        	.preloader__house {
        		position: relative;
        		height: 100%;
        		display: -webkit-box;
        		display: -ms-flexbox;
        		display: flex;
        		-webkit-box-pack: center;
        		-ms-flex-pack: center;
        		justify-content: center;
        		-webkit-box-align: center;
        		-ms-flex-align: center;
        		align-items: center;
        		z-index: 1;
        	}
        
        	.preloader__house svg {
        		position: relative;
        		z-index: 1;
        	}
        
        	.preloader__house-icon {
        		-webkit-transform: translateX(156px);
        		transform: translateX(156px);
        	}
        
        	@media only screen and (max-width: 576px) {
        		.preloader__house-icon {
        			width: 100px;
        			-webkit-transform: translateX(76px);
        			transform: translateX(76px);
        		}
        	}
        
        	.preloader__house::before {
        		position: absolute;
        		content: '';
        		width: 5000px;
        		right: -10px;
        		height: 100%;
        		background: #3E3E3E;
        	}
        
        	.preloader__title {
        		-webkit-transform: translateX(-300px);
        		transform: translateX(-300px);
        	}
        
        	@media only screen and (max-width: 576px) {
        		.preloader__title {
        			width: 150px;
        			height: 60px;
        		}
        	}
        
        	.preloader-is-loading .preloader__house-icon {
        		-webkit-animation: shine 1.75s linear infinite;
        		animation: shine 1.75s linear infinite;
        	}
        
        	@-webkit-keyframes shine {
        		0% {
        			opacity: .5;
        		}
        		50% {
        			opacity: 1;
        		}
        		100% {
        			opacity: .5;
        		}
        	}
        
        	@keyframes shine {
        		0% {
        			opacity: .5;
        		}
        		50% {
        			opacity: 1;
        		}
        		100% {
        			opacity: .5;
        		}
        	}
        </style>
